import {ADD_FILE, SET_FORM_DATA_VALUE} from "./actionTypes";

const initialState = {
    exel: false,
    file: null,
    errorType: null,
    uploadText: '',
    formData: {
        departOne : [
            {id: 1, name: 'sku'},
            {id: 2, name: 'name'},
            {id: 3, name: 'points'},
            {id: 4, name: 'measurement'}
        ],
        departTwo : [
            {id: 5, name: 'classifiers'},
            {id: 6, name: 'suppliers'},
            {id: 7, name: 'barcode'},
            {id: 8, name: 'description'},
        ],
    },
    formDataValue: {
        sku: '1',
        name: '2',
        points: '3',
        measurement: '4',
        classifiers: '5',
        suppliers: '6',
        barcode: '7',
        description: '8',
    }
};

export default function importReducer(state = initialState, action) {

    switch (action.type) {

        case SET_FORM_DATA_VALUE:
            return {
                ...state,
                formDataValue: action.formDataValue
            }
        case ADD_FILE:
            return {
                ...state,
                [action.name]: action.value
            }
        default: return state;
    }
}
